$(document).ready(function($) {
    ////species
    $("#species").append("<option value='none'>none</option>");
    $("#species").append("<optgroup label='----------'></optgroup>");
    //mainspecies
    for (var i in mainspecies) {
        $("#species").append("<option value=" + mainspecies[i].value + ">" + mainspecies[i].info + "</option>");
    }
    $("#species").append("<optgroup label='----------'></optgroup>");
    //otherspecies
    for (var i in otherspecies) {
        $("#species").append("<option value=" + otherspecies[i].value + ">" + otherspecies[i].info + "</option>");
    }

    //種が変更されたら、画像を変更
    $("#species").change(function() {
        //選択された種を特定
        var selectedspecies = $.grep(allspecies,
            function(elem) {
                return (elem.value == $("#species").val());
            }
        );
        //画像をロード
        var img = new Image();
        img.src = "images/species/" + selectedspecies[0].image + ".png";
        $("#species_image").attr("src", img.src);
        //選択された種のinfoを表示
        $("#species_name").text($("#species :selected").text());
    });
});